import Login from "../Pages/Login/Login";
import ForgotPassword from "../Pages/ForgotPassword/ForgotPassword";

//PUBLIC PAGES

const publicRoutes = [
  { path: "/login", component: Login },
  { path: "/forgotpassword", component: ForgotPassword },
];

export { publicRoutes };
